export enum TemplateType {
  CategoryRoot = "template-root",
  Category = "template-category",
  Template = "template",
  Varaint = "template-variant",
}

export enum TemplateMenu {
  Left = "left",
  Tab = "tab",
  Inline = "inline",
}

export enum TemplateContext {
  Summary = "summary",
  Feedback = "feedback",
  AssociateContent = "summaryassociatecontent",
  Interaction = "interaction",
}
